INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 1, 7001, 1, -363.0, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 0.0, "2015/12/17 15:00:00", "キャル", 106001, 7, 0.0, "2030/12/17 14:59:59", 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 1, 7002, 1, -363.0, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 0.0, "2015/12/17 15:00:00", "コッコロ", 105901, 7, 0.0, "2030/12/17 14:59:59", 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 1, 7003, 1, -363.0, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 0.0, "2015/12/17 15:00:00", "ペコリーヌ", 105801, 7, 0.0, "2030/12/17 14:59:59", 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 1, 10001, 1, -363.0, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 0.0, "2015/12/17 15:00:00", "ペコリーヌ", 105801, 10, 0.0, "2030/12/17 14:59:59", 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 1, 10002, 1, -363.0, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 0.0, "2015/12/17 15:00:00", "キャル", 106001, 10, 0.0, "2030/12/17 14:59:59", 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 1, 10003, 1, -363.0, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 0.0, "2015/12/17 15:00:00", "コッコロ", 105901, 10, 0.0, "2030/12/17 14:59:59", 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (2, 1, 10004, 1, -363.0, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 0.0, "2015/12/17 15:00:00", "シェフィ", 106401, 10, 0.0, "2030/12/17 14:59:59", 2104010, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 1, 12001, 1, -416.5, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 0.0, "2015/12/17 15:00:00", "ペコリーヌ", 105801, 12, 0.0, "2030/12/17 14:59:59", 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 1, 13001, 1, -363.0, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 0.0, "2015/12/17 15:00:00", "キャル", 106001, 13, 0.0, "2030/12/17 14:59:59", 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 1, 13002, 1, -363.0, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 0.0, "2015/12/17 15:00:00", "コッコロ", 105901, 13, 0.0, "2030/12/17 14:59:59", 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (2, 1, 13003, 1, -363.0, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 0.0, "2015/12/17 15:00:00", "シェフィ", 106401, 13, 0.0, "2030/12/17 14:59:59", 2104010, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 1, 13004, 1, -363.0, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 0.0, "2015/12/17 15:00:00", "ペコリーヌ", 105801, 13, 0.0, "2030/12/17 14:59:59", 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 1, 14001, 1, -363.0, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 0.0, "2015/12/17 15:00:00", "コッコロ", 105901, 14, 0.0, "2030/12/17 14:59:59", 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (2, 1, 14002, 1, -363.0, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 0.0, "2015/12/17 15:00:00", "シェフィ", 106401, 14, 0.0, "2030/12/17 14:59:59", 2104010, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 1, 14003, 1, -363.0, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 0.0, "2015/12/17 15:00:00", "ペコリーヌ", 105801, 14, 0.0, "2030/12/17 14:59:59", 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 1, 14004, 1, -363.0, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 0.0, "2015/12/17 15:00:00", "キャル", 106001, 14, 0.0, "2030/12/17 14:59:59", 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 1, 15001, 1, -470.0, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 0.0, "2015/12/17 15:00:00", "コッコロ", 105901, 15, 0.0, "2030/12/17 14:59:59", 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (2, 1, 16001, 1, -363.0, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 0.0, "2015/12/17 15:00:00", "シェフィ", 106401, 16, 0.0, "2030/12/17 14:59:59", 2104010, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 1, 16002, 1, -363.0, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 0.0, "2015/12/17 15:00:00", "ペコリーヌ", 105801, 16, 0.0, "2030/12/17 14:59:59", 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 1, 16003, 1, -363.0, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 0.0, "2015/12/17 15:00:00", "キャル", 106001, 16, 0.0, "2030/12/17 14:59:59", 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 1, 16004, 1, -363.0, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 0.0, "2015/12/17 15:00:00", "コッコロ", 105901, 16, 0.0, "2030/12/17 14:59:59", 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 1, 17002, 1, -363.0, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 0.0, "2015/12/17 15:00:00", "コッコロ", 105901, 17, 0.0, "2030/12/17 14:59:59", 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 1, 17004, 1, -363.0, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 0.0, "2015/12/17 15:00:00", "キャル", 106001, 25, 0.0, "2030/12/17 14:59:59", 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 1, 17005, 1, -363.0, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 0.0, "2015/12/17 15:00:00", "コッコロ", 105901, 25, 0.0, "2030/12/17 14:59:59", 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (2, 1, 17006, 1, -363.0, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 0.0, "2015/12/17 15:00:00", "シェフィ", 106401, 25, 0.0, "2030/12/17 14:59:59", 2104010, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 1, 17007, 1, -363.0, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 0.0, "2015/12/17 15:00:00", "ペコリーヌ", 105801, 25, 0.0, "2030/12/17 14:59:59", 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 1, 18001, 1, -363.0, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 0.0, "2015/12/17 15:00:00", "カリン", 190801, 18, 0.0, "2030/12/17 14:59:59", 0, 0);
