INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 1, 20001, 5, -470.0, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 0.0, "2015/12/17 15:00:00", "カリン", 190801, 20, 0.0, "2030/12/17 14:59:59", 0, 0);
