INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 1, 21001, 1, -363.0, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 0.0, "2015/12/17 15:00:00", "キャル", 106001, 21, 0.0, "2030/12/17 14:59:59", 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 1, 21002, 1, -363.0, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 0.0, "2015/12/17 15:00:00", "コッコロ", 105901, 21, 0.0, "2030/12/17 14:59:59", 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (2, 1, 21003, 1, -363.0, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 0.0, "2015/12/17 15:00:00", "シェフィ", 106401, 21, 0.0, "2030/12/17 14:59:59", 2104010, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 1, 21004, 1, -363.0, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 0.0, "2015/12/17 15:00:00", "ペコリーヌ", 105801, 21, 0.0, "2030/12/17 14:59:59", 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 1, 22001, 1, -430.0, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 0.0, "2015/12/17 15:00:00", "カリン", 190801, 22, 0.0, "2030/12/17 14:59:59", 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 1, 22002, 2, -430.0, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 0.0, "2015/12/17 15:00:00", "カリン", 190801, 22, 0.0, "2030/12/17 14:59:59", 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 1, 23001, 3, -430.0, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 0.0, "2015/12/17 15:00:00", "カリン", 190801, 23, 0.0, "2030/12/17 14:59:59", 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 1, 23002, 4, -430.0, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 0.0, "2015/12/17 15:00:00", "カリン", 190801, 23, 0.0, "2030/12/17 14:59:59", 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 2, 24001, 1, -385.0, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 8.0, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 109001, 24, 4.08, "2030/12/17 14:59:59", 0, 10011);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 2, 24002, 2, -385.0, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 8.0, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 109001, 24, 5.0, "2030/12/17 14:59:59", 0, 10011);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 2, 24003, 3, -385.0, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 8.0, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 109001, 24, 10.11, "2030/12/17 14:59:59", 0, 10011);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 2, 24004, 4, -385.0, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 8.0, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 109001, 24, 4.0, "2030/12/17 14:59:59", 0, 10011);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 2, 24005, 5, -385.0, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 8.0, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 109001, 24, 6.0, "2030/12/17 14:59:59", 0, 10011);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 1, 24006, 6, 0.0, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 0.0, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 109002, 24, 0.0, "2030/12/17 14:59:59", 0, 10011);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 1, 24007, 7, 0.0, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 0.0, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 109002, 24, 0.0, "2030/12/17 14:59:59", 0, 10011);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 1, 24008, 8, 0.0, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 0.0, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 109002, 24, 0.0, "2030/12/17 14:59:59", 0, 10011);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 1, 24009, 9, 0.0, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 0.0, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 109002, 24, 0.0, "2030/12/17 14:59:59", 0, 10011);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 1, 24010, 10, 0.0, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 0.0, "2019/01/31 12:00:00", "エリコ（バレンタイン）", 109002, 24, 0.0, "2030/12/17 14:59:59", 0, 10011);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 2, 24011, 1, -385.0, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 8.0, "2019/01/31 12:00:00", "シズル（バレンタイン）", 109101, 24, 2.12, "2030/12/17 14:59:59", 0, 10011);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (5, 2, 24012, 2, -385.0, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 8.0, "2019/01/31 12:00:00", "シズル（バレンタイン）", 109101, 24, 4.19, "2030/12/17 14:59:59", 0, 10011);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (2, 4, 24013, 3, -385.0, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 8.0, "2019/01/31 12:00:00", "シズル（バレンタイン）", 109101, 24, 2.3, "2030/12/17 14:59:59", 0, 10011);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 1, 24014, 4, 0.0, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 0.0, "2019/01/31 12:00:00", "シズル（バレンタイン）", 109102, 24, 0.0, "2030/12/17 14:59:59", 0, 10011);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (5, 2, 24015, 5, -385.0, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 8.0, "2019/01/31 12:00:00", "シズル（バレンタイン）", 109101, 24, 5.23, "2030/12/17 14:59:59", 0, 10011);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 1, 24016, 6, 0.0, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 0.0, "2019/01/31 12:00:00", "シズル（バレンタイン）", 109102, 24, 0.0, "2030/12/17 14:59:59", 0, 10011);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 2, 24017, 7, -385.0, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 8.0, "2019/01/31 12:00:00", "シズル（バレンタイン）", 109101, 24, 5.01, "2030/12/17 14:59:59", 0, 10011);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 1, 24018, 8, 0.0, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 0.0, "2019/01/31 12:00:00", "シズル（バレンタイン）", 109102, 24, 0.0, "2030/12/17 14:59:59", 0, 10011);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 1, 24019, 9, 0.0, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 0.0, "2019/01/31 12:00:00", "シズル（バレンタイン）", 109102, 24, 0.0, "2030/12/17 14:59:59", 0, 10011);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (1, 1, 24020, 10, 0.0, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 0.0, "2019/01/31 12:00:00", "シズル（バレンタイン）", 109102, 24, 0.0, "2030/12/17 14:59:59", 0, 10011);
